window.bookSummaryJSON = "<p><b>She wants to protect him. He can't stay away.</b></p> <p>Kennedy Lowe wasn’t supposed to walk away, taking my heart with her. Now she’s gone, but I’m determined to get her back. I want to save her. Punish her. In the end, I’ll make sure she knows exactly who she belongs to.</p> <p>Conner Jagger wasn’t to supposed to save me, but he did. Now I’ll do anything to protect him and the people he calls family. He’s good. Worth fighting for. In the end, I'll do whatever it takes. He might be the boy I betrayed, and I might the girl with nothing left to lose, but one thing’s for sure: He won’t let me go without a fight. Even if it means risking everything.</p> <p><i>Temper Him </i>is book six of the Rebels at Sterling Prep, a possessive, immoral, dark high school bully-romance series.</p>"; 
